import { useNavigate } from 'react-router-dom';


function Quiz() {
    const navigate = useNavigate();

    return (
        <main className='page-main d-flex justify-content-center align-items-center'>
            <div className='text-center'>Quiz Select</div>
            <div className='home-buttons'>
                <button className='btn'>General</button>
                <button className='btn'>Entertainment</button>
                <button className='btn'>Science</button>
                <button className='btn'>Mythology</button>
                <button className='btn'>Sports</button>
                <button className='btn'>History</button>
                <button className='btn'>Politics</button>
                <button className='btn'>Art</button>
                <button className='btn' onClick={() => { navigate('/') }}>Home</button>
            </div>
        </main>
    )
}

export default Quiz
